        const url = 'https://corona.lmao.ninja/v2/all?yesterday';
        let data = await fetch(url);
        return await data.json();
    }
    const fetcchData = async () => {
        const data = await axios.get('https://corona.lmao.ninja/v2/all?yesterday');
        setStrains(data.cases);
        setLoading(false);
    }
    const [counter, setCounter] =  useState(()=>{
        return globalCases();
    });
    console.log(globalCases);
    return (
        <div className={classes.sheet__wrapper}>
            <table>
                <thead>
                    <td>Global cases!</td>
                </thead>
                <tbody>
                    <td>{counter}</td>
                </tbody>
            </table>
        </div>
    );
};
  
export default Global;
